useEffect(() =>{
    fetch('http://localhost:8000/blogs')
    .then(res => {
       return res.json();
    })
    .then(data => {
        setBlogs(data)
    })
}, []);

    return ( 
        <div className="home">
           {blogs &&<BlogList blogs={blogs} title="All the Blogs!" handleDelete= {handleDelete}></BlogList>}
        </div>
     );
}
 
export default Home;
